 INSERT INTO srdb.assessment VALUES('WGBFAS-CODBA2224-1969-2007-JENNINGS', 'WGBFAS', 'CODBA2224', 'JENNINGS', '2008-11-18', '2011-06-24 12:22:30', '1969-2007', 'http://www.ices.dk/', 'NULL', 'NULL', '', 1, 1, 'XSA', 'The quality of the commercial landings and catch-at-age data for this stock deteriorated in the 1990s following reductions in the TAC without associated control of fishing effort. The WG considers the international landings figures from 1993 onwards to have inaccuracies that lead to retrospective underestimation of fishing mortality and over estimation of spawning stock biomass and other problems with an analytical assessment. The assessment is, however, consistent, despite problems with discards.', '../spreadsheets/JENNINGS-ICES-COD2224-1970-2007-editedDR-QAQC.xls', '999') ; 
